    false,nt"url": null,nt"notes": "This narrative report for Burford Lake
    Wildlife Management Area outlines Refuge accomplishments from January through April
    of 1951. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, raptors, and fish- is also covered. The Refuge
    development and maintenance section discusses physical developments. Resource management
    is outlined; topics include grazing, fur harvesting, and timber removal. The public
    relations section of the report describes recreational uses, Refuge visitors, and
    Refuge participation. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
